import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">

<header class="header">
    <img src="<%= require('./images/Vector.png')%>" alt="Место - Russia" class="header__logo" />
  </header>

  <main class="content">

<section class="profile">
  <img src="<%= require('./images/avatar.jpg')%>" class="profile__avatar" />
  <button class="profile__avatar-btn"></button>
  <div class="profile__info">
    <h1 class="profile__name"></h1>
    <p class="profile__job"></p>
    <button class="profile__edit" type="button">Редактировать</button>
  </div>
  <button class="add-button" type="button">Добавить фото</button>
</section>

<section class="elements"></section>
</main>
    </div>
  );
}

export default App;
